import Head from 'next/head';
import React from 'react';
import styled from 'styled-components';
import Link from 'next/link'


import {Wrapper, Title} from './HomePage.styles'

const HomePage = () => (
  <Wrapper>
    <Head>
      <title>Home</title>
    </Head>

    <Title>Cluster Universities App</Title>
    <Link href={`/ProgramDetailPage?pid=123`}>
      <a>School Page</a>
    </Link>
  </Wrapper>
);



export default HomePage;
